import React, {useState} from 'react';

const Form=()=>{

    let [NewName,update]=useState();
    let [FullName,update1]=useState();
    

    const Input=(event)=>{
        update(event.target.value);
            
        }
    const showName=()=>{
        update1(NewName);
    }
    return (
        <>
        <label htmlFor="">Hello {FullName}</label> <br />
        <input type="text" onChange={Input} value='' placeholder='Enter Your Name'/><br />
        <button type='submit' onClick={showName}>Submit</button>
        </>
    )
}

export default Form;
